import React from 'react';
import Grid from '@material-ui/core/Grid';
import styled from 'styled-components';

const Portfolio = () => {

    const Title = styled.h1`
        font-size: 30px;
        color: #566366;
        margin: auto;
        margin-top: 30px;
    `;

    const Text = styled.p`
        color: #919191;
        font-size: 20px;
        text-align: center;
        padding: 0 20px 0 20px;
    `;

    return(
        <Grid container>
            <Title>Portfolio</Title>
            <Text>Lorem ipsum dolor sit amet, ea doming epicuri iudicabit nam, te usu virtute placerat. Purto brute disputando cu est, eam dicam soluta ei. Vel dicam vivendo accusata ei, cum ne periculis molestiae pri. </Text>
        </Grid>
    )
}

export default Portfolio;
